import React from "react";
import FilterPanel from "../../components/common/FilterPanel/FilterPanel";
import MovieList from "../../components/MovieList/MovieList";
import { movies } from "../../data/movies";
import { Gender } from "../../data/genders";
import "./Home.scss";
import { FilterOrders } from "../../data/filter/filterOrders";

const Home = () => {
  const genders = Object.keys(Gender).map((gender) => {
    return Gender[gender].name;
  });

  const filterOrders = Object.keys(FilterOrders).map((filterOrder) => {
    return FilterOrders[filterOrder].name;
  });

  return (
    <React.Fragment>
      <div className="home" style={{ paddingTop: "4rem" }}>
        <FilterPanel title="Genres" values={genders} />
        <FilterPanel title="Date" values={filterOrders} />
        <MovieList movies={movies} />
      </div>
    </React.Fragment>
  );
};

export default Home;
